import Button from './Button/Button';
import React from 'react';
import './Input.css';

const input = (props) => {
    return (
        <div className = "Input">
            <input className="TextInput" text="text" value={props.textInput} onChange={props.onChangeHandler}></input>
            <Button clicked={props.addItem}/>
        </div>
    )
}

export default input;
